import { useState } from "react";
import { Link } from "react-router-dom";

const Contato = () => {
    const [nome, setNome] = useState();
    const [email, setEmail] = useState();
    const [telefone, setTelefone] = useState();
    const [assunto, setAssunto] = useState();
    const [mensagem, setMensagem] = useState(null);

    const enviarFormulario = async (e) => {
        e.preventDefault();

        const url = "http://127.0.0.1:8000/api/enviar-mensagem";

        const csrfToken = document.cookie.match(/XSRF-TOKEN=([^;]+)/)[1];
        console.log(csrfToken);
        
        const novaMensagem = {
            nome,
            email,
            telefone,
            assunto,
            mensagem,
        };

        // const res = await fetch(url, {
        //     method: "POST",
        //     headers: {
        //         "Access-Control-Allow-Headers": "*",
        //         "Content-Type": "application/json",
        //         "X-XSRF-TOKEN" : csrfToken
        //     },
        //     body: JSON.stringify(novaMensagem)
        // });

    }

    return (
        <div className="container div-sobre">
            <div className="row">
                <div className="col-md-8 col-md-offset-2 text-center fh5co-heading">
                    <h3>Contato</h3>
                </div>
            </div>
            <div className="row">
                <form className="form-horizontal form-variavel form-head" onSubmit={enviarFormulario}>
                    <div className="form-group">
                        <div className="col-md-12">
                            <input
                                type="text"
                                className="input form-control"
                                placeholder="Digite seu Nome"
                                onChange={(e) => setNome(e.target.value)} />
                        </div>
                    </div>
                    <div className="form-group">
                        <div className="col-md-12">
                            <input
                                type="text"
                                className="input form-control"
                                placeholder="Digite seu E-mail"
                                onChange={(e) => setEmail(e.target.value)} />
                        </div>
                    </div>
                    <div className="form-group">
                        <div className="col-md-12">
                            <input
                                type="text"
                                className="input form-control"
                                placeholder="Digite seu Telefone"
                                onChange={(e) => setTelefone(e.target.value)} />
                        </div>
                    </div>
                    <div className="form-group">
                        <div className="col-md-12">
                            <input
                                type="text"
                                className="input form-control"
                                placeholder="Assunto"
                                onChange={(e) => setAssunto(e.target.value)} />
                        </div>
                    </div>
                    <div className="form-group">
                        <div className="col-md-12">
                            <textarea
                                name="mensagem"
                                className="input form-control"
                                placeholder="Mensagem"
                                onChange={(e) => setMensagem(e.target.value)}>
                            </textarea>
                        </div>
                    </div>

                    <div className="div-voltar">
                        <Link to="/"><button type="button" className="btn waves-effect waves-light btn-voltar">Voltar</button></Link>
                        <button type="submit" className="btn waves-effect btn-success waves-light btn-voltar">Enviar Mensagem</button>
                    </div>
                </form>
            </div>
        </div>
    );
};

export default Contato;
